Walk-in Care provides for immediate care needs without scheduling an appointment. Just walk-in at one of three convenient locations when you're sick and see one of our providers.

Minor injuries or illnesses that can be treated by one of our Walk-In Care departments include sprains and minor broken bones, minor cuts, earaches, sore throat or cough, mild to moderate asthma, and minor infections. More serious medical conditions may require urgent, emergency care. Patients should call 911 for emergencies.
